import React from "react";

import Link from "next/link";

const Footer = props => {
  return (
    <div className="mt-5 pt-5 pb-5 footer">
      <div className="container text-center">
        <div className="row">
          <div className="col-lg-3">
            <p className="">
              <small className="text-white-50">Contact Us</small>
            </p>
          </div>
          <div className="col-lg-3">
            <p className="">
              <small className="text-white-50">Terms</small>
            </p>
          </div>
          <div className="col-lg-3">
            <p className="">
              <small className="text-white-50">Privacy</small>
            </p>
          </div>
          <div className="col-lg-3">
            <p className="">
              <small className="text-white-50">About Us</small>
            </p>
          </div>
        </div>
        <div className="row mt-5">
          <div className="col copyright">
            <p className="">
              <small className="text-white-50">
                Â© 2020. Travel Blog All Rights Reserved.
              </small>
            </p>
          </div>
        </div>
      </div>
      <style jsx>{`
        .footer {
          background: #2d73c0;
          color: white;
        }
        .footer .links ul {
          list-style-type: circle;
        }
        .footer .links li a {
          color: white;
          -webkit-transition: color 0.2s;
          transition: color 0.2s;
        }
        .footer .links li a:hover {
          text-decoration: none;
          color: #4180cb;
        }
        .footer .about-company i {
          font-size: 25px;
        }
        .footer .about-company a {
          color: white;
          -webkit-transition: color 0.2s;
          transition: color 0.2s;
        }
        .footer .about-company a:hover {
          color: #4180cb;
        }
        .footer .location i {
          font-size: 18px;
        }
        .footer .copyright p {
          border-top: 1px solid rgba(255, 255, 255, 0.1);
        }
      `}</style>
    </div>
  );
};

export default Footer;
